      out.write("\t\t\t\t\t\t<h4>안심클릭 대상카드</h4>\n");
      out.write("\t\t\t\t\t\t<ul class=\"text-list01\">\n");
      out.write("\t\t\t\t\t\t\t<li>국민카드/ BC카드/ 우리카드를 제외한 모든 신용카드</li>\n");
      out.write("\t\t\t\t\t\t\t<li>삼성/ 외환/ 롯데/ 현대/ 신한/ 시티/ 신세계한미/ 한미/ 수협/ 전북/ 광주/ 제주/ 조흥/ 신한(구 LG)</li>\n");
      out.write("\t\t\t\t\t\t\t<li>국내전용카드/ 마스터/ JCB 모두 포함</li>\n");
      out.write("\t\t\t\t\t\t</ul>\n");
      out.write("\t\t\t\t\t\t<h4>안심클릭 인증방식</h4>\n");
      out.write("\t\t\t\t\t\t<ul class=\"text-list01\">\n");
      out.write("\t\t\t\t\t\t\t<li>카드사가 제공하는 팝업창에서 선택가능<br>안심클릭, 공인인증 중 1개 선택 (안심클릭만으로 결제 가능)</li>\t\t\t\t\t\t\t\t\t\n");
      out.write("\t\t\t\t\t\t</ul>\n");
      out.write("\t\t\t\t\t\t<h4>결제페이지 입력정보</h4>\n");
      out.write("\t\t\t\t\t\t<ul class=\"text-list01\">\n");
      out.write("\t\t\t\t\t\t\t<li>기존 : 카드번호, 유효기간, 주민번호, 카드비밀번호, 할부기간 입력</li>\n");
      out.write("\t\t\t\t\t\t\t<li>안심클릭 시행 후 : 카드번호, 할부기간만 입력</li>\t\t\t\t\t\t\t\t\n");
      out.write("\t\t\t\t\t\t</ul>\n");
      out.write("\t\t\t\t\t\t<h4>등록방법</h4>\n");
      out.write("\t\t\t\t\t\t<ul class=\"text-list01\">\n");
      out.write("\t\t\t\t\t\t\t<li>주문/결제 페이지에서 카드사에서 제공하는 팝업화면 통해 바로 등록 및 사용 가능, 고객님이 소유한 신용카드의 카드사 홈페이지 통해 등록 가능</li>\n");
      out.write("\t\t\t\t\t\t\t<li>VISA카드를 가지고 계신 고객님들 중, 이미 VISA안심클릭을 등록해 사용하시고 계신 분은 별도의 안심 클릭 등록절차없이 기존대로 결제가 가능하십니다.</li>\n");
      out.write("\t\t\t\t\t\t\t<li>추가적으로 더 궁금한 사항은 1:1 고객상담으로 문의 주시기 바랍니다.</li>\n");
      out.write("\t\t\t\t\t\t</ul>\n");
      out.write("\t\t\t\t\t\t<a href=\"/helpdesk\" class=\"btn fill btnW\">1:1 고객상담</a>\n");
      out.write("\t\t\t\t\t</div>\n");
      out.write("\t\t\t\t\t<!--// 안심클릭 카드 안내 -->\n");
      out.write("\t\t\t\t\t\n");
      out.write("\t\t\t\t\t\n");
      out.write("\t\t\t\t\t<!-- 네이버페이 이용안내 -->\n");
      out.write("\t\t\t\t\t<div class=\"guideInfoArea\">\n");
      out.write("\t\t\t\t\t\t<h2 class=\"title02\">네이버페이 이용안내</h2>\t\n");
      out.write("\t\t\t\t\t\t<ul class=\"text-list02\">\n");
      out.write("\t\t\t\t\t\t\t<li>네이버페이는 네이버ID로 별도 앱 설치 없이 신용카드 또는 은행계좌 정보를 등록하여 네이버페이 비밀번호로 결제할 수 있는 간편결제 서비스입니다.</li>\n");
      out.write("\t\t\t\t\t\t\t<li>주문 변경 시 카드사 혜택 및 할부 적용 여부는 해당 카드사 정책에 따라 변경될 수 있습니다.\n");
      out.write("\t\t\t\t\t\t\t\t<ul class=\"text-list01\">\n");
      out.write("\t\t\t\t\t\t\t\t\t<li><strong>결제 가능한 신용카드 :</strong>신한, 삼성, 현대, BC, 국민, 하나, 롯데, NH농협, 씨티</li>\n");
      out.write("\t\t\t\t\t\t\t\t\t<li><strong>결제 가능한 은행 :</strong>NH농협, 국민, 신한, 우리, 기업, SC제일, 부산, 경남, 수협, 우체국, 미래에셋대우, 광주, 대구, 전북, 새마을금고, 제주은행, 신협, 하나은행 </li>\n");
      out.write("\t\t\t\t\t\t\t\t</ul>\t\t\t\t\t\t\t\t\n");
      out.write("\t\t\t\t\t\t\t</li>\n");
      out.write("\t\t\t\t\t\t\t<li>네이버페이 카드 간편결제는 네이버페이에서 제공하는 카드사별 무이자, 청구할인 혜택을 받을 수 있습니다.\t</li>\t\t\t\t\t\t\n");
      out.write("\t\t\t\t\t\t</ul>\n");
      out.write("\t\t\t\t\t</div>\t\t\t\t\t\t\n");
      out.write("\t\t\t\t\t\n");
