      out.write("\t\t\t\t\t\t\t<li>실시간 계좌이체는 결제와 동시에 입출금이 처리 됩니다.</li>\n");
      out.write("\t\t\t\t\t\t\t<li>이체 수수료는 부과되지 않습니다.</li>\t\t\t\t\t\t\t\n");
